    {
      "lineNumber": 266666,
      "originalJapaneseLine": "きちんと畳んで籠に入れた。",
      "translatedEnglishLine": "neatly folded them, and put them into the basket."
    },
    {
      "lineNumber": 266667,
      "originalJapaneseLine": "「ぐうぐう……」",
      "translatedEnglishLine": "\"Snore snore...\""
    },
    {
      "lineNumber": 266668,
      "originalJapaneseLine": "「……おおっ」",
      "translatedEnglishLine": "\"...Oh!\""
    },
    {
      "lineNumber": 266669,
      "originalJapaneseLine": "「あ、起きた」",
      "translatedEnglishLine": "\"Ah, she's awake.\""
    },
    {
      "lineNumber": 266670,
      "originalJapaneseLine": "「ん、むぅ……」",
      "translatedEnglishLine": "\"Mmm, ugh...\""
    },
    {
      "lineNumber": 266671,
      "originalJapaneseLine": "「お風呂……お風呂……」",
      "translatedEnglishLine": "\"Bath... bath...\""
    },
    {
      "lineNumber": 266672,
      "originalJapaneseLine": "「あ、寝ぼけたまま行っちゃった……」",
      "translatedEnglishLine": "\"Ah, she went while still half-asleep...\""
    },
    {
      "lineNumber": 266673,
      "originalJapaneseLine": "「しかし、眠ったまま風呂に入るとは、",
      "translatedEnglishLine": "\"But to enter the bath while asleep,"
    },
    {
      "lineNumber": 266674,
      "originalJapaneseLine": "　あいつも大概器用な奴だな……」",
      "translatedEnglishLine": "she's quite a skillful one...\""
    },
    {
      "lineNumber": 266675,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 266676,
      "originalJapaneseLine": "「はっ！？",
      "translatedEnglishLine": "\"Huh?!"
    },
    {
      "lineNumber": 266677,
      "originalJapaneseLine": "　そういえば中には男がいるのでは！？",
      "translatedEnglishLine": "Wait, isn't there a man inside!?\""
    },
