      "lineNumber": 266678,
      "originalJapaneseLine": "「どわあああああああ！？",
      "translatedEnglishLine": "\"Whaaaaaaaat!?"
    },
    {
      "lineNumber": 266679,
      "originalJapaneseLine": "　せせせ、セスナ殿ー！？",
      "translatedEnglishLine": "\"Se-se-Setsuna-dono!?\""
    },
    {
      "lineNumber": 266680,
      "originalJapaneseLine": "「うおおお！",
      "translatedEnglishLine": "\"Uooooh!"
    },
    {
      "lineNumber": 266681,
      "originalJapaneseLine": "　お前ら見るんじゃねー！」",
      "translatedEnglishLine": "You guys better not look!\""
    },
    {
      "lineNumber": 266682,
      "originalJapaneseLine": "ランスは慌てて風呂場へと向かった。",
      "translatedEnglishLine": "Rance hurriedly headed to the bath."
    },
