      "lineNumber": 266683,
      "originalJapaneseLine": "…………",
      "translatedEnglishLine": "........"
    },
    {
      "lineNumber": 266684,
      "originalJapaneseLine": "……",
      "translatedEnglishLine": "..."
    },
    {
      "lineNumber": 266685,
      "originalJapaneseLine": "「やれやれ……」",
      "translatedEnglishLine": "\"Good grief...\""
    },
    {
      "lineNumber": 266686,
      "originalJapaneseLine": "ランスは男湯から自分以外の男を追い出し、",
      "translatedEnglishLine": "Rance drove out all men except himself from the men's bath,"
    },
    {
      "lineNumber": 266687,
      "originalJapaneseLine": "ほっと息を吐いていた。",
      "translatedEnglishLine": "and let out a relieved sigh."
    },
    {
      "lineNumber": 266688,
      "originalJapaneseLine": "「まったく、こいつのおかげで、",
      "translatedEnglishLine": "\"Really, thanks to her,"
    },
    {
      "lineNumber": 266689,
      "originalJapaneseLine": "　ひとっ風呂浴びる前に無駄に汗かいたぞ」",
      "translatedEnglishLine": "I ended up sweating unnecessarily before even taking a bath.\""
    },
    {
      "lineNumber": 266690,
      "originalJapaneseLine": "「むむ、呑気にぐうぐうと寝おって……",
      "translatedEnglishLine": "\"Hmm, sleeping so peacefully without a care..."
    },
    {
      "lineNumber": 266691,
      "originalJapaneseLine": "　なんかいたずらしてやろうか」",
      "translatedEnglishLine": "Maybe I should play a little trick on her.\""
    },
    {
      "lineNumber": 266692,
      "originalJapaneseLine": "「……おおっ」",
      "translatedEnglishLine": "\"...Oh!\""
    },
    {
      "lineNumber": 266693,
      "originalJapaneseLine": "「あ、起きた」",
      "translatedEnglishLine": "\"Ah, she's awake.\""
    },
    {
      "lineNumber": 266694,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 266695,
      "originalJapaneseLine": "セスナは辺りをきょろきょろと伺い、",
